import React from 'react';
import Tabs from './components/Tabs';
import './App.css';

function App() {
    return (
        <div>
            <h1>Tabs Demo</h1>
            <Tabs>
                <li label="Alligator">
                    See ya later, <em>Alligator</em>!
                </li>
            </Tabs>
        </div>
    );
}

export default App;
